import React from 'react'
import './App.css'
import { Button, Container } from 'react-bootstrap';
import Footer from './components/Footer';
const App = () => {
  return (
    <>
      <main>
        <Container>
          <h1>Abdullah Store</h1>
        </Container>
      </main>
      <Footer />
    </>
  )
}

export default App
